const Edu2 = () => {
    return (
        <div className='tc bg-#C38D9E dib br3 pa3 ma2 grow bw2 shadow-5'>
            <p>January '12 > December '12</p>
            <p>________________________________________</p>
            <h6>Honours Degree (B.Sc. Hons.)</h6>
            <h6>Physiological Sciences</h6>
            <p>________________________________________</p>
            <p>Stellenbosch University</p>
        </div>
    );
}

export default Edu2;
